import React, { useState, useEffect } from "react";

const Temp = () => {
  const [blob, setBlob] = useState(null);

  useEffect(() => {
    async function fetchImage() {
      try {
        const response = await fetch("../images/pew.jpeg"); // Replace with the actual path
        const imageBlob = await response.blob();
        
        setBlob(URL.createObjectURL(imageBlob));
      } catch (error) {
        console.error("Error fetching image:", error);
      }
    }

    fetchImage();
  }, []);

  if (!blob) {
    return <p>Loading...</p>;
  }


  return (
    <div>
      <img src={blob} alt="processed" />
    </div>
  );
};

export default Temp;
